import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    const title = 'Give feedback';

    let votes = {
        good_votes: 0,
        neutral_votes: 0,
        bad_votes: 0
    }

    return (
        <div>
            <Header title={title}/>
            <Buttons/>
            <Table votes={votes}/>
        </div>
    )
}

const Header = (props) => {
    return (
        <h1>{props.title}</h1>
    )
}

const Buttons = () => {
    return (
        <>
            <button>Vote up</button>
            <button>Vote neutral</button>
            <button>Vote down</button>
        </>
    )
}

const Table = (props) => {
    props.votes
}

ReactDOM.render(<App/>, document.getElementById('root'))
